import React from "react";
import "./Header.css";
// import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="header">
      <a href="/">FunNy /^^/</a>
      <div className="subheader">
        <div className="search"></div>
        <p>/WELCOME/</p>
      </div>
    </div>
  );
};

export default Header;
